        fieldOfView %<= horizontalFieldOfView >%
        horizontalResolution %<= Math.round(horizontalFieldOfView / angularResolution)  >%
        verticalFieldOfView %<= wbutility.degreesToRadians(0.8 * (measurementLayers + 1)) >%
        numberOfLayers %<= measurementLayers >%
        minRange 0.5
        maxRange 300
        noise IS noise
      }
      Lidar {
        %<
